<td colspan="2" rowspan="1" class="c18">
<p class="c14"><span class="c7">Advantages</span></p>
</td>
<td colspan="1" rowspan="1" class="c49">
<p class="c35"><span class="c27">Bored pile are used to support multi-story building or bridges which can producing heavy vertical loads</span></p>
</td>
<td colspan="1" rowspan="1" class="c55">
<p class="c35"><span class="c9">They are quick to install and have </span></p>
<p class="c35"><span class="c9">no requirement for temporary or permanent casings</span></p>
</td>
<td colspan="1" rowspan="1" class="c24">
<p class="c3"><span class="c27">Driven piles are driven to a set in variable site conditions to achieve uniform minimum capacity with high reliability</span></p>
</td>
