<td colspan="2" rowspan="1" class="c18">
<p class="c14"><span class="c16 c7">Methodology</span></p>
</td>
<td colspan="1" rowspan="1" class="c49">
<p class="c35"><span class="c9">Pile drilled / soil removed and replaced with reinforced concrete</span></p>
</td>
<td colspan="1" rowspan="1" class="c55">
<p class="c35"><span class="c9">Auger drilled into ground and replaced with concrete as the auger is removed</span></p>
</td>
<td colspan="1" rowspan="1" class="c24">
<p class="c3"><span class="c9">Steel section driven into the ground</span></p>
</td>
