</td>
<td colspan="1" rowspan="1" class="c41">
<p class="c63 c52"><span class="c9">Effect on adjacent ground</span></p>
</td>
<td colspan="1" rowspan="1" class="c30">
<p class="c22"><span class="c9">No displacement of the soil but the potential for relaxation / softening adjacent ground, dependant upon the soil and bore support used</span></p>
</td>
<td colspan="1" rowspan="1" class="c44">
<p class="c63 c52"><span class="c9">Typically no displacement with good construction controls</span></p>
<p class="c3"><span class="c9">Localised densification of loose non-cohesive soils.</span></p>
</td>
<td colspan="1" rowspan="1" class="c2">
<p class="c52 c63"><span class="c9">Small cross sectional area and hence minimal soil displacement or potential improvement</span></p>
